import React from 'react';
import "./css/header.css";
import { ImMobile } from 'react-icons/ai';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faGift,faMapMarkerAlt,faMobileAlt,faQuestionCircle } from '@fortawesome/free-solid-svg-icons';
import {Container,Row,Col} from 'react-bootstrap';
import 'bootstrap/dist/css/bootstrap.min.css';


function Head(){
   return(
    <div className="head">
        <Container fluid>
            <Row>
                <Col></Col>
                <Col><p><a href="App.js"><span class="icon"><ImMobile size="5px"/></span> Get it</a> | <a href="App.js"><FontAwesomeIcon icon={faMapMarkerAlt}/>Store & Events</a> | <a href="App.js"><FontAwesomeIcon icon={faGift}/>Gift Card</a> | <a href="App.js"><FontAwesomeIcon icon={faQuestionCircle}/>Help</a> </p>
                </Col>
            </Row>
        </Container>
    </div>
   ) ;
}
export default Head;
